import axios from "axios";
import { actionsQuestionsTasks } from "./actionsQuestionsTasks";

export const fetchModels = () => (dispatch) => {
  axios
    .get("http://127.0.0.1:8000/get_categories/", { category: "theory python" })
    .then((response) => {
      dispatch(actionsCategories(response.data));
      dispatch(actionsQuestionsTasks(response.data));
    })
    .catch((error) => {
      console.log(error);
    });
};

export const actionsCategories = (obj) => ({
  type: "ACTIONS_CATEGORIES",
  payload: obj,
});
